class UserStory:
    def __init__(self, story_id, description, user_role):
        self.story_id = story_id
        self.description = description
        self.user_role = user_role

    def __repr__(self):
        return f"UserStory(id={self.story_id}, role={self.user_role}, description={self.description})"


class UserStoryManager:
    def __init__(self):
        self.stories = []

    def add_story(self, story_id, description, user_role):
        story = UserStory(story_id, description, user_role)
        self.stories.append(story)

    def filter_stories_by_role(self, role):
        return [story for story in self.stories if story.user_role == role]

    def display_all_stories(self):
        for story in self.stories:
            print(story)


class UIStoryManager(UserStoryManager):
    def __init__(self):
        super().__init__()

    def track_design_updates(self):
        return [story for story in self.stories if 'UI designer' in story.user_role]

    def schedule_user_testing(self):
        return [story for story in self.stories if 'schedule user testing' in story.description]


class DeveloperStoryManager(UserStoryManager):
    def __init__(self):
        super().__init__()

    def log_improvements(self):
        return [story for story in self.stories if 'Developer' in story.user_role]

    def manage_d_file_requests(self):
        return [story for story in self.stories if 'D Files generation' in story.description]


class AgencyUserStoryManager(UserStoryManager):
    def __init__(self):
        super().__init__()

    def view_submissions(self):
        return [story for story in self.stories if 'submission' in story.description]

    def validate_data(self):
        return [story for story in self.stories if 'validate' in story.description]


class FABSUserStoryManager(UserStoryManager):
    def __init__(self):
        super().__init__()

    def view_files(self):
        return [story for story in self.stories if 'access published FABS files' in story.description]


def main():
    manager = UserStoryManager()

    # Adding stories
    manager.add_story(1, "As a Data user, I want to have the 12-19-2017 deletions processed.", "Data user")
    manager.add_story(2, "As a UI designer, I want to redesign the Resources page.", "UI designer")
    manager.add_story(3, "As a Developer, I want to log better.", "Developer")
    manager.add_story(4, "As an agency user, I want to access published FABS files.", "Agency user")
    manager.add_story(5, "As a FABS user, I want to have read-only access to DABS.", "FABS user")

    # Display all stories
    print("All User Stories:")
    manager.display_all_stories()

    # Filter stories by role
    ui_design_stories = manager.filter_stories_by_role("UI designer")
    print("\nUI Designer Stories:")
    for story in ui_design_stories:
        print(story)

    # Initialize specific managers
    ui_manager = UIStoryManager()
    dev_manager = DeveloperStoryManager()
    agency_manager = AgencyUserStoryManager()
    fabs_manager = FABSUserStoryManager()

    # Manage UI stories
    ui_manager.add_story(2, "As a UI designer, I want to redesign the Resources page.", "UI designer")
    ui_manager.add_story(6, "As a UI designer, I want to track the issues that come up in Tech Thursday.", "UI designer")

    print("\nUI Design Updates:")
    for story in ui_manager.track_design_updates():
        print(story)

    # Manage Developer stories
    dev_manager.add_story(3, "As a Developer, I want to log better.", "Developer")
    dev_manager.add_story(1, "As a Developer, I want D Files generation requests to be managed.", "Developer")

    print("\nDeveloper Log Improvements:")
    for story in dev_manager.log_improvements():
        print(story)

    # Manage Agency user stories
    agency_manager.add_story(4, "As an agency user, I want to access published FABS files.", "Agency user")
    agency_manager.add_story(5, "As an agency user, I want to validate data.", "Agency user")

    print("\nAgency User View Submissions:")
    for story in agency_manager.view_submissions():
        print(story)

    # Manage FABS user stories
    fabs_manager.add_story(5, "As a FABS user, I want to have read-only access to DABS.", "FABS user")

    print("\nFABS User View Files:")
    for story in fabs_manager.view_files():
        print(story)


if __name__ == "__main__":
    main()
